import React from "react";
import circleImage from "./img/imagecircle.png"

function About(){
    return (
        <div className=" h-screen bg-opacity-5 bg-teal-500 mt-10 p-5 flex">
            <div className="mx-auto">
                <h3 className=" text-center text-3xl font-bold text-teal-500">Biodata</h3>
                <img className="w-44" src={circleImage} alt="circlephoto"/>
                <p></p>
            </div>
        </div>
    );
}

export default About;
